  const [age, setAge] = useState("0");
  const [gender, setGender] = useState("male");
  const longStirng = useMemo(() => age + name + gender, [age, name, gender]);
  console.log(longStirng);
  return (
    <div className=" flex justify-center">
      <Total />
      <Time />
      <HomeShop grd={gender}/>
      <ToyShop />
    </div>
  );
};

export default Counter;
